import styles from './Main.module.scss';
import Header from './Header/Header';


function Main () {

  return (
    <div className={styles.container_barmen}>
      <Header />
      <main className={styles.main}>
        <div className={styles.form}>
          <Form />
        </div>
        <div className={styles.map}>
          <Map />
        </div>
      </main>
    </div>
  );
}

export default Main;
